INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (4, 24015, 10021, "カオリ（サマー）", 110501, 1, 0.0, "2019/07/31 12:00:00", 4, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (4, 24016, 10021, "カオリ（サマー）", 110501, 2, 0.0, "2019/07/31 12:00:00", 1, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (4, 24017, 10021, "カオリ（サマー）", 110501, 3, 0.0, "2019/07/31 12:00:00", 4, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (1, 24018, 10021, "カオリ（サマー）", 110501, 4, 0.0, "2019/07/31 12:00:00", 2, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (5, 24019, 10021, "カオリ（サマー）", 110501, 5, 0.0, "2019/07/31 12:00:00", 6, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (2, 24020, 10021, "カオリ（サマー）", 110501, 6, 0.0, "2019/07/31 12:00:00", 2, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (1, 24021, 10021, "カオリ（サマー）", 110501, 7, 0.0, "2019/07/31 12:00:00", 6, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (2, 24022, 10021, "カオリ（サマー）", 110501, 8, 0.0, "2019/07/31 12:00:00", 2, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (6, 24023, 10021, "カオリ（サマー）", 110501, 9, 0.0, "2019/07/31 12:00:00", 3, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (1, 24024, 10021, "カオリ（サマー）", 110501, 10, 0.0, "2019/07/31 12:00:00", 2, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (2, 24025, 10021, "カオリ（サマー）", 110501, 11, 0.0, "2019/07/31 12:00:00", 2, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 0.0, "2030/12/17 14:59:59");
